var config = configuration;
var accountName = configuration['account.name'];
var response = response_body;

for(let i = 0; i < response.length; i++) {
 	if(response[i].name === accountName) {
		config['account.id'] = response[i].id;	
    done({
			"continue" : true,
			"configuration": config
		})
  }
}
done({
	"continue": false,
  "response_body": { "error": "Unable to create Instance. Please check credentials" },
  "response_status_code": 400
})

if (request_body_map) {
  var hits = request_body_map.hits;
    if (hits && hits.constructor === Array) {
		var vendorBody = '';
        hits.forEach(function(hitRequest) {
            for (let param in hitRequest) {
                var value = hitRequest[param];
                // Proceed only if concrete values are passed
                if (value && value.constructor !== Array && value.constructor !== Object) {
                    vendorBody += param + '=' + value + '&';
                }
            }
			      //Remove trailing '&'
            vendorBody = vendorBody.slice(0, -1);
            // Add new line character after every hit request,
            // Using ASCII code as this editor converts `slash n` into new line
            vendorBody = vendorBody.concat(String.fromCharCode(10));
        });
        //Remove trailing 'new line char'
        vendorBody = vendorBody.slice(0, -1);
        done({
            "request_vendor_body": vendorBody
        });
    }
}
done({
    "continue": false,
    "response_body": {
        "error": `Bad Request. Malformed request body.`
    },
    "response_status_code": 400
});

if (response_iserror) {
  done();
}
// Make vendor specific payload available for next API
done({
    "response_body": request_vendor_body
});
